// SPDX-License-Identifier: GPL-2.0-or-later
pragma solidity =0.7.6;
pragma abicoder v2;

import "./Interface.sol";
import "@uniswap/v3-core/contracts/interfaces/callback/IUniswapV3FlashCallback.sol";
import "@uniswap/v3-core/contracts/libraries/LowGasSafeMath.sol";
import "hardhat/console.sol";
import "@uniswap/v3-periphery/contracts/base/PeripheryPayments.sol";
import "@uniswap/v3-periphery/contracts/base/PeripheryImmutableState.sol";
import "@uniswap/v3-periphery/contracts/libraries/PoolAddress.sol";
import "@uniswap/v3-periphery/contracts/libraries/CallbackValidation.sol";
import "@uniswap/v3-periphery/contracts/libraries/TransferHelper.sol";
import "@uniswap/v3-periphery/contracts/interfaces/ISwapRouter.sol";

contract MyContract is
    Interface,
    IUniswapV3FlashCallback,
    PeripheryImmutableState,
    PeripheryPayments
{
    using LowGasSafeMath for uint256;
    using LowGasSafeMath for int256;
    enum Direction {
        Uniswap_Kyber,
        Kyber_Uniswap
    }

    ISwapRouter public immutable swapRouter;
    address DMMFactoryAddress = 0x833e4083B7ae46CeA85695c4f7ed25CDAd8886dE;
    address _DMMRouter = 0x1c87257F5e8609940Bc751a07BB085Bb7f8cDBE6;
    uint256 amount0;
    uint256 amount1;
    event Bal(uint256, string);

    constructor(
        ISwapRouter _swapRouter,
        address _factory,
        address _WETH9
    ) PeripheryImmutableState(_factory, _WETH9) {
        swapRouter = _swapRouter;
    }

    function uniswapV3FlashCallback(
        uint256 fee0, ////this is fee2 for first swap
        uint256 fee1, ////this is fee3 for second swap
        bytes calldata data
    ) external override {
        FlashCallbackData memory decoded = abi.decode(
            data,
            (FlashCallbackData)
        );
        CallbackValidation.verifyCallback(factory, decoded.poolKey);

        amount0 = balance(
            0x2791Bca1f2de4661ED88A30C99A7a9449Aa84174,
            address(this),
            "USDC before swap"
        );
        amount1 = balance(
            0x8f3Cf7ad23Cd3CaDbD9735AFf958023239c6A063,
            address(this),
            "DAI before swap"
        );
        emit Bal(amount0, "USDC before swap");
        emit Bal(amount1, "DAI before swap");
        address token0 = decoded.poolKey.token0;
        address token1 = decoded.poolKey.token1;
        uint256 token1out = swapExactInputSingle(
            token0,
            token1,
            decoded.poolFee2,
            decoded.amount0
        );
        amount0 = balance(
            0x2791Bca1f2de4661ED88A30C99A7a9449Aa84174,
            address(this),
            "USDC after uniswap"
        );
        amount1 = balance(
            0x8f3Cf7ad23Cd3CaDbD9735AFf958023239c6A063,
            address(this),
            "DAI after uniswap"
        );
        emit Bal(amount0, "USDC after Uniswap swap");
        emit Bal(amount1, "DAI after Uniswap swap");
        uint256 token0out = SushiswapExactTokensForTokens(amount1, token1, token0);
        amount0 = balance(
            0x2791Bca1f2de4661ED88A30C99A7a9449Aa84174,
            address(this),
            "USDC after sushiswap"
        );
        amount1 = balance(
            0x8f3Cf7ad23Cd3CaDbD9735AFf958023239c6A063,
            address(this),
            "DAI after sushiswap"
        );
        emit Bal(amount0, "USDC after sushiswap swap");
        emit Bal(amount1, "DAI after sushiswap swap");
        uint256 amount0Owed = LowGasSafeMath.add(decoded.amount0, fee0);
        uint256 amount1Owed = LowGasSafeMath.add(decoded.amount1, fee1);

        TransferHelper.safeApprove(token0, address(this), amount0Owed); // this is for returning fl to pool (msg.sender)
        TransferHelper.safeApprove(token1, address(this), amount1Owed); // this is for returning fl to pool (msg.sender)

        if (amount0Owed > 0)
            pay(token0, address(this), msg.sender, amount0Owed); //return flash sum back to swaprouter (msg.sender)
        if (amount1Owed > 0)
            pay(token1, address(this), msg.sender, amount1Owed); //return flash sum back to swaprouter (msg.sender)
        amount0 = balance(
            0x2791Bca1f2de4661ED88A30C99A7a9449Aa84174,
            address(this),
            "USDC after return"
        );
        amount1 = balance(
            0x8f3Cf7ad23Cd3CaDbD9735AFf958023239c6A063,
            address(this),
            "DAI after return"
        );
        emit Bal(amount0, "USDC after return");
        emit Bal(amount1, "DAI after return");
    }

    //fee1 is the fee of the pool from the initial borrow
    //fee2 is the fee of the first pool to arb from
    //fee3 is the fee of the second pool to arb from
    struct FlashParams {
        address token0;
        address token1;
        uint24 fee1;
        uint256 amount0;
        uint256 amount1;
        uint24 fee2;
        uint24 fee3;
    }
    // fee2 and fee3 are the two other fees associated with the two other pools of token0 and token1
    struct FlashCallbackData {
        uint256 amount0;
        uint256 amount1;
        address payer;
        PoolAddress.PoolKey poolKey;
        uint24 poolFee2;
        uint24 poolFee3;
    }

    /// @param params The parameters necessary for flash and the callback, passed in as FlashParams
    /// @notice Calls the pools flash function with data needed in `uniswapV3FlashCallback`
    function initFlash(FlashParams memory params) external {
        PoolAddress.PoolKey memory poolKey = PoolAddress.PoolKey({
            token0: params.token0,
            token1: params.token1,
            fee: params.fee1
        });
        IUniswapV3Pool pool = IUniswapV3Pool(
            PoolAddress.computeAddress(factory, poolKey)
        );
        // recipient of borrowed amounts
        // amount of token0 requested to borrow
        // amount of token1 requested to borrow
        // need amount 0 and amount1 in callback to pay back pool
        // recipient of flash should be THIS contract
        pool.flash(
            address(this),
            params.amount0,
            params.amount1,
            abi.encode(
                FlashCallbackData({
                    amount0: params.amount0,
                    amount1: params.amount1,
                    payer: msg.sender,
                    poolKey: poolKey,
                    poolFee2: params.fee2,
                    poolFee3: params.fee3
                })
            )
        );
    }
}

